CREATE VIEW [dbo].[ViewMessageUser]
AS
SELECT        dbo.Admin.Name, dbo.Admin.Surname, dbo.Admin.Image, dbo.Admin.UserName, dbo.Admin.Email, dbo.MessageRooms.Name AS RoomName, dbo.Message.RoomId, dbo.Message.Message, dbo.Message.SenderRole, 
                         dbo.Message.SendDate
FROM            dbo.Admin INNER JOIN
                         dbo.Message ON dbo.Admin.Id = dbo.Message.SenderId AND dbo.Message.SenderRole = 'user' INNER JOIN
                         dbo.MessageRooms ON dbo.Message.RoomId = dbo.MessageRooms.Id
GO
