/****** Object:  View [dbo].[ViewMessageAll]    Script Date: 3.12.2021 02:37:21 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO




CREATE VIEW [dbo].[ViewMessageAll]
AS
       SELECT Name, Surname, Image, UserName, Mail, RoomName, RoomId, Message, SenderRole, SendDate
FROM            dbo.ViewMessageCurrent 
						 UNION ALL
				SELECT Name, Surname, Image, UserName, Email, RoomName, RoomId, Message, SenderRole, SendDate
FROM            dbo.ViewMessageStaff
UNION ALL
				SELECT Name, Surname, Image, UserName, Email, RoomName, RoomId, Message, SenderRole, SendDate
FROM            dbo.ViewMessageAdmin
UNION ALL
				SELECT Name, Surname, Image, UserName, Email, RoomName, RoomId, Message, 'admin', SendDate
FROM            dbo.ViewMessageUser
GO
