SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

CREATE VIEW [dbo].[ViewUserAll]
AS
       SELECT Id,Name, Surname, Image, UserName, Mail, 'current' as 'Role'
FROM            dbo.[Current] 
						 UNION ALL
				SELECT Id,Name, Surname, Image, UserName, Email, 'staff' as 'Role'
FROM            dbo.Staff
UNION ALL
				SELECT Id,Name, Surname, Image, UserName, Email, 'admin' as 'Role'
FROM            dbo.Admin
GO
