INSERT [dbo].[TimeLine] ([Id], [Title], [Description], [Date], [Lang], [MemberId], [MemberRole], [TLEkstraId], [IsAll]) VALUES (2017, N'Gösterge Paneli İşlemleri', N'<p><span style="font-weight: bolder;">Gösterge Paneli İşlemleri&nbsp;</span>tamamlandı. Böylelikle;</p><ul><li>Kullanıcı giriş yaptıktan sonra ilk olarak gösterge paneliyle karşılaşacak.</li><li>Yapılacaklar Listesinin ilk 10 elemanını görebilecek ve düzenleyebilecek.</li><li><span style="font-weight: bolder;">Aylık Satış Grafiği''</span>ni gözlemleyebilecek. Tüm fonksiyonları eklemedim ama eklenebilir</li><li><span style="font-weight: bolder;">Swappo kartlarından</span>&nbsp;hızlıca gözlemleme yapabilecek.</li><li><span style="font-weight: bolder;">Takvimi&nbsp;</span>ve o andaki ay ve günü görebilecek. Hızlıca büyük takvime gidebilecek.</li><li><span style="font-weight: bolder;">Harita</span>&nbsp;ve haritadaki durumları görebilecek. ,Geliştirilmeli,</li><li>Ekibe&nbsp;<span style="font-weight: bolder;">en son katılan personelleri&nbsp;</span>görebilecek.</li><li>&nbsp;Direkt mesajlaşma yapabilecek. -Aktif değil-</li><li>Satılan son ürünlerin kısa bir listesini görebilecek.&nbsp;</li><li>En son eklenen ürünlerin kısa listesini görebilecek.</li></ul>', CAST(N'2021-01-19T22:46:57.620' AS DateTime), N'tr', 1, N'admin', 2013, 1)
