INSERT [dbo].[TimeLine] ([Id], [Title], [Description], [Date], [Lang], [MemberId], [MemberRole], [TLEkstraId], [IsAll]) VALUES (2019, N'SIGNAL-R Anlık Mesajlaşma Eklentisi', N'<p><b>SIGNAL-R Anlık Mesajlaşma Eklentisi </b>ile;</p><ul><li><b>Tüm kullanıcılar</b> tek bir panelde, aynı gruplarda gizli veya ortak şekilde konuşabilirler.</li><li><b>Mesajlar, çevrimiçi kullanıcılar</b> gibi özellikler sisteme giriş yapmış ve <b>mesaj grubuna katılmış olan kullanıcılar çevrimiçi oldukları süre boyunca anlık olarak -sayfaları yenilenmeden-&nbsp;</b>güncellenir.</li><li>Grup içerisinde gizli olarak başka bir kullanıcıya mesaj gönderilebilir.</li><li>Yeni grup eklenebilir veya kaldırılabilir.</li></ul><p>Ek olarak;&nbsp;</p><ul><li>SignalR yapısı kullanılmıştır.</li><li><a href="https://github.com/AKouki/SignalR-Chat" target="_blank">github.com</a>&nbsp;bu linkteki proje temel alınarak hazırlanmıştır.</li></ul><p><img src="data:image/png;base64," data-filename="image.png" style="width: 100%;"><br></p>', CAST(N'2021-01-20T20:16:38.203' AS DateTime), N'tr', 1, N'admin', 2012, 1)
