INSERT [dbo].[TimeLine] ([Id], [Title], [Description], [Date], [Lang], [MemberId], [MemberRole], [TLEkstraId], [IsAll]) VALUES (2026, N'Sistemdeki Mail Adreslerine Email Gönderme', N'<p><b>Sistemdeki Mail Adreslerine Email Gönderme </b>ile;</p><ul><li>Sisteme üye olan veya kayıt edilen kullanıcının email adresi ve kullanıcı adı benzersiz olmak zorundadır.</li><li>Sistemde bulunmayan email adreslerine <b>message/compose</b> adresindeki formdan mail gönderilemez.</li><li>Her roldeki kullanıcılar birbiriyle mailleşebilir.&nbsp;</li><li>Mail sistemi sadece bu projeyi kapsar. Üçüncü taraf uygulamalarla etkileşimde bulunmaz.</li></ul>', CAST(N'2021-01-25T00:30:12.870' AS DateTime), N'tr', 1, N'admin', 2021, 1)
