INSERT [dbo].[TimeLine] ([Id], [Title], [Description], [Date], [Lang], [MemberId], [MemberRole], [TLEkstraId], [IsAll]) VALUES (2027, N'Bildirim Sistemi', N'<p><b>Bildirim Sistemi</b> ile;</p><ul><li>Üst bardaki bildirimler okunmamış bildirimlere göre veri alıyor.&nbsp;</li><li>Bildirimler türlerine göre kullanıcılara <b>otomatik mesaj gönderiyor.</b></li><li>Kullanıcılara tekli veya çoklu bildirim gönderebiliyor. Örneğin; bir <b>kargo şirketi eklendiğinde</b> mesaj <b>tüm aktif personel </b>ve <b>yöneticilere </b>giderken, <b>departman eklenmesi </b>durumunda<b> kayıtlı müşteriler dahil tüm kullanıcılara</b> bildirim gönderiyor.</li><li>Bildirimler <b>okundu/okunmadı </b>kutucuğuyla etkileşimi arttırmayı hedefliyor.</li><li>Her kullanıcı kendine gönderilen bildirimleri listesinden <b>görebiliyor </b>ve <b>silebiliyor</b>.</li></ul>', CAST(N'2021-01-25T23:33:39.657' AS DateTime), N'tr', 1, N'admin', 2022, 1)
GO
INSERT [dbo].[TimeLine] ([Id], [Title], [Description], [Date], [Lang], [MemberId], [MemberRole], [TLEkstraId], [IsAll]) VALUES (2028, N'E-Posta Kutuları ve Posta Göndeme', N'<p><b>E-Posta Kutuları ve Posta Göndeme </b>ile;</p><ul><li>Gelen Kutusu</li><li>Gönderilenler Kutusu,</li><li>Favorilerim Kutusu,</li><li>Geçici Silinenler Kutusu,</li><li>Taslaklar Kutusu olmak üzere 5 e-posta kutu seçeneği aktifleştirilmiştir.&nbsp;</li></ul><p>Ek olarak,&nbsp;<span style="font-size: 1rem;"><b>E-posta gönderme aktifleştirilmiştir ve böylelikle</b></span><span style="font-size: 1rem;">;</span></p><ul><li>E-posta formu içerisinde gönderici<b>&nbsp;konu, email adresi ya da açıklama</b>&nbsp;yazmaya başladıktan sonra <b>her yazmaya devam etmediği 3 saniyenin</b>&nbsp;sonunda posta otomatik olarak <b>taslak olarak</b> kaydedilir. Ve bu posta gönderilmediği taktirde taslaklarda bulunur ve tekrardan düzenlenip gönderilebilir.</li><li>Kullanıcı <b>kendi email adresine</b> <b>postalama </b>işlemi <b>yapamaz</b>. Bu durumda sistem tarafından uyarı çıkartılır.</li><li>Kullanıcı <b>Swapp-OFC</b> sisteminde <b>kayıtlı olmayan bir email adresine postalama yapamaz</b>. Yapmaya çalıştığında bir uyarı ile karşılaşır.</li><li>Summernote editörü ile kullanıcı deneyimi arttırılır.</li><li>Kullanıcı yazmaya başladığında sistemdeki butonlar devre dışı kalır. Böylelike sistemde oluşabilecek sorunların önüne geçilmesi amaçlanır.</li></ul><p>Dahası;&nbsp;</p><ul><li>E-Posta kutularında ,<b>konu ve açıklamayı kapsayan</b>, arama yapılabilir.</li><li>E-Postalar bir sayfada maksimum 20 kere veritabanından alınır ve gösterilir. Kullanıcı diğer postalarına listenin altındaki ok butonu ile geçebilir. Böylelikle sistem yükü hafifletilmeye çalışılmıştır.</li><li>Alt bölümde yer alan <b>"Tümünü Seç", "Sil" </b>ve <b>"Yenile"</b> butonları aktifleştirilmiş ve ilaveten kontrol kutucukları ile seçim yapılarak <b>toplu silme işlemi </b>yapılması <b>aktifleştirilmiştir</b>.&nbsp;</li><li>E-postaya tıklandığında <b>posta okundu</b> olarak işaretlenir.</li></ul>', CAST(N'2021-01-27T23:46:38.367' AS DateTime), N'tr', 1, N'admin', 2023, 1)
GO
