INSERT [dbo].[TimeLine] ([Id], [Title], [Description], [Date], [Lang], [MemberId], [MemberRole], [TLEkstraId], [IsAll]) VALUES (3036, N'Yetkilendirme ve Hata Ayıklama İşlemleri', N'<p>Sistemdeki oluşan veya oluşabilecek hatalar gözden geçirilmiştir ve birçok hata çözülmüştür. Ek olarak, deneyimleyecek kullanıcılar için de yetkilendirme yapılmıştır. Böylelikle;</p><p>Kullanıcılar;</p><ul><li>Yöneticilerin görebildikleri neredeyse her şeyi görebilecek,</li><li>Ekleme ve düzenleme yapabilecek,</li><li>Silme işlemlerini yapamayacaktır.</li><li>önüne geçilmeye çalışılmıştır,</li></ul><p><br></p><ul><li>Sistemi yavaşlatacak veya çökertebilecek kötü niyetli veri girişinin ,</li><li>Sistemdeki oluşabilecek hataların,&nbsp;</li><li>önüne geçilmeye çalışılmıştır.</li></ul>', CAST(N'2021-02-07T01:42:22.607' AS DateTime), N'tr', 1, N'admin', 1011, 1)
